Pour faire communiquer correctement, il faut ajouter la règle suivante : open,read,unlink,write dans init_t > admin_home_t > file Pour cela, créez un fichier pm2_systemd.te avec le contenu suivant : module pm2_systemd 1.0; require { type admin_home_t; type init_t; class file { open read unlink write };
} #============= init_t ==============
allow init_t admin_home_t:file { open read unlink write }; Il est alors possible d'ajouter la règle via les commandes suivantes : checkmodule -M -m -o pm2_systemd.mod pm2_systemd.te
semodule_package -o pm2_systemd.pp -m pm2_systemd.mod
semodule -i pm2_systemd.pp

