Éditons le fichier /etc/nginx/nginx.conf comme suit : # For more information on configuration, see:
user nginx;
worker_processes auto;
error_log /var/log/nginx/error.log;
pid /run/nginx.pid; # Load dynamic modules. See /usr/share/doc/nginx/README.dynamic.
include /usr/share/nginx/modules/*.conf; events { worker_connections 1024;
} http { log_format main '$remote_addr - $remote_user [$time_local] "$request" ' '$status $body_bytes_sent "$http_referer" ' '"$http_user_agent" "$http_x_forwarded_for"'; access_log /var/log/nginx/access.log main; sendfile on; tcp_nopush on; tcp_nodelay on; keepalive_timeout 65; types_hash_max_size 2048; include /etc/nginx/mime.types; default_type application/octet-stream; include /etc/nginx/conf.d/*.conf;
} Pour la configuration du backend, éditons le fichier /etc/nginx/conf.d/backend.conf Attention, modifiez bien le $BACKEND_DOMAIN dans le fichier avec le nom de domaine du frontend server { listen 80; server_name $BACKEND_DOMAIN; location / { proxy_set_header X-Real-IP $remote_addr; proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for; proxy_set_header X-Forwarded-Proto $scheme; proxy_set_header Host $host; proxy_set_header X-NginX-Proxy true; proxy_pass http://localhost:3000; proxy_redirect http://localhost:3000/ http://$server_name/; }
} Pour la configuration du frontend, éditons le fichier /etc/nginx/conf.d/frontend.conf Attention, modifiez bien le $FRONTEND_DOMAIN dans le fichier avec le nom de domaine du frontend server { listen 80; server_name $FRONTEND_DOMAIN; location / { proxy_set_header X-Real-IP $remote_addr; proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for; proxy_set_header X-Forwarded-Proto $scheme; proxy_set_header Host $host; proxy_set_header X-NginX-Proxy true; proxy_pass http://localhost:3001; proxy_redirect http://localhost:3001/ http://$server_name/; }
}

