Une fois installé, il faut créer les règles SELinux suivantes : search dans mongod_t > cgroup_t > dir getattr, open, read dans mongod_t > cgroup_t > file open, read dans mongod_t > proc_net_t > file search dans mongod_t > sysctl_net_t > dir Ainsi que le fichier mongodb_stargate.te suivant : module mongodb_stargate 1.0; require { type cgroup_t; type proc_net_t; type sysctl_net_t; type mongod_t; class file { getattr open read }; class dir search;
} #============= mongod_t ============== allow mongod_t cgroup_t:dir search;
allow mongod_t cgroup_t:file { getattr open read };
allow mongod_t proc_net_t:file { open read };
allow mongod_t sysctl_net_t:dir search;
allow mongod_t sysctl_net_t:file { open getattr read }; Puis lancez les commandes suivantes : checkmodule -M -m -o mongodb_stargate.mod mongodb_stargate.te
semodule_package -o mongodb_stargate.pp -m mongodb_stargate.mod
semodule -i mongodb_stargate.pp
